import React from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Login from './components/pages/Login';

const App = () => {
  return (
    <Router>
      <Route path='/login'>
        <Login />
      </Route>
    </Router>
  )
}

export default App
